def count_elements(my_list):
    """"""
    count_list = []
    for element in my_list:
        count = 0
        for item in my_list:
            if element == item:
                count += 1
        if (element, count) not in count_list:
            count_list.append((element, count))
    count_list.sort(key=lambda x: x[1], reverse=True)
    return count_list
